import { BrowserRouter } from 'react-router-dom';
import Main from './pages/Main';

function App() {
  return (
    <div className="App">
      <header className="App-header">hello</header>
      <BrowserRouter>
        <Routes>
          <Route index element={<Main />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
